const BusDetails=[
  {
    classN:"row  mt-5",
    type:"text",
    for:"companyname",
    labelC:"col-4",
    name:"Company Name:",
    inputC:"form-control col-5",
    placeholder:"Company Name"
  },
  {
    classN:"row  mt-5",
    type:"text",
    for:"",
    labelC:"col-4",
    name:"Business type:",
    inputC:"form-control col-5",
    placeholder:"Business type"
  },
  {
    classN:"row  mt-5",
    type:"text",
    for:"name",
    labelC:"col-4",
    name:"Business owner:",
    inputC:"form-control col-5",
    placeholder:"Business owner"
  },
  {
    classN:"row  mt-5",
    type:"tel",
    for:"contact_num",
    labelC:"col-4",
    name:"Phone number1:",
    inputC:"form-control col-5",
    placeholder:"phone 1"
  },
  {
    classN:"row  mt-5",
    type:"tel",
    for:"contact_num",
    labelC:"col-4",
    name:"Phone number2:",
    inputC:"form-control col-5",
    placeholder:"phone 2"
  },
  {
    classN:"row mt-5",
    type:"email",
    for:"email",
    labelC:"col-4",
    name:"E-mail:",
    inputC:"form-control col-5",
    placeholder:"Email Adress"
  },
  {
    classN:"row  mt-5",
    type:"text",
    for:"city",
    labelC:"col-4",
    name:"City:",
    inputC:"form-control col-5",
    placeholder:"City"
  },
  {
    classN:"row  mt-5",
    type:"text",
    for:"street",
    labelC:"col-4",
    name:"Street:",
    inputC:"form-control col-5",
    placeholder:"street"
  },
  {
    classN:"row  mt-5",
    type:"text",
    for:"zip",
    labelC:"col-4",
    name:"Zip Code:",
    inputC:"form-control col-5",
    placeholder:"Zip code"
  },
  {
    classN:"row  mt-5",
    type:"text",
    for:"usrname",
    labelC:"col-4",
    name:"Username:",
    inputC:"col-5",
    placeholder:"Choose Username"
  },
  {
    classN:"row  mt-5",
    type:"text",
    for:"psw",
    labelC:"col-4",
    name:"Password:",
    inputC:"col-5",
    placeholder:"Enter Password"
  },
  {
    classN:"row  mt-5",
    type:"text",
    for:"psw-repeat",
    labelC:"col-4",
    name:"Repeat Password:",
    inputC:"col-5",
    placeholder:"Repeat Password"
  }

]
export default BusDetails
